def is_even(number):
    if number % 2 == 0:
        return True
    else:
        return False

def digit_sum_recur(number):
    if number == 0:
        return 0
    else:
        return number % 10 + digit_sum_recur(number/10)

def main():
    n = int(input("Enter number: "))
    print("Sum of digits", n, "is", digit_sum_recur(n))

def factorial(x):
    total = 1
    while x > 1:
        total *= x
        x -= 1
    return total

def is_prime(x):
    if x < 2:
        return False
    else:
        for n in range(2, x - 1):
            if x % n == 0:
                return False
        return True

def reverse2(text):
    """Reverse a string recursively."""
    text_list = list(text)
    if len(text_list) == 1:
        return text_list[0]
    else:
        return text_list[-1] + reverse2(text_list[:-1])

def censor(text,word):
  str = ""
  for i in range(len(word)):
    if i == 0 or i == len(word)-1:
      str+=word[i]
    else:
      str+="*"
  text=text.replace(word,str)
  return text

def count(sequence, item):
    found = 0
    for i in sequence:
        if i == item:
            found += 1
    return found

def purify(numbers):
    new_list = []
    for i in numbers:
        if i % 2 == 0:
            new_list.append(i)
    return new_list

def product(numbers):
    total = 1
    for i in numbers:
        total *= i
    return total

def remove_duplicates(numbers):
    new_list = []
    for i in numbers:
        if i not in new_list:
            new_list.append(i)
    return new_list

def median(numbers):
    numbers.sort()
    if len(numbers) % 2 == 0:
        middle_index_1 = int(len(numbers) / 2) - 1
        middle_index_2 = middle_index_1 + 1
        return (numbers[middle_index_1] + numbers[middle_index_2]) / 2.0
    else:
        middle_index = int(len(numbers) / 2)
        return numbers[middle_index]
